namespace WABot.Helpers
{
   /// <summary>
   /// Auxiliary static class that stores strings in Base64 format for sending files
   /// </summary>
    public static class Base64String
    {
        public static string Mp4 { get; private set; } = "data:video/mp4;base64,";
        public static string Mp3 { get; private set; } = "data:audio/mp3;base64,";
        public static string Doc { get; private set; } = "data:application/vnd.openxmlformats-officedocument.wordprocessingml.document;base64,";
        public static string Pdf { get; private set; } = "data:application/pdf;base64,";
        public static string Jpg { get; private set;} = "data:image/jpeg;base64,";

        public static string Png { get; private set; } = "data:image/png;base64,";
        public static string Gif { get; private set; } = "data:image/gif;base64,";
    }
}
